function [HCL,HRCL] = combat_centiloid(TRACERSUVR,TRACERmod)
% Convert the SUVR values of a certain Abeta tracer into centiloid format
% Input the SUVR values of abeta PET images in 84 brain regions, TRACERSUVR, 
% where the 84 brain regions are the cortical regions selected in the article
% It can be calculated by atlas in folder ROI_FOR_SUVR
% The size of TRACERSUVR is n*84, where n is the number of abeta PET images
% Considering the nature of the ComBat algorithm, it is required that n is 
% preferably greater than 30 and includes three types of subjects: CN, MCI, and AD.
% Input the demographic information of each image, TRACERmod
% TRACERmod is [age, gender, is AD, is MCI],wich is a n*4 matrix;
% age (years), gender 1 for male, 0 for female
% Output the harmonized CL values, HCL, and the CL values of each brain region, HRCL
% The function combat_to_center.m is a slightly modified version of combat.m
% from the ComBat harmonization in Matlab project (https://github.com/Jfortin1/
% ComBatHarmonization/tree/master/Matlab), allowing alignment with a specific center.
% You can use the data in the TestData folder for testing
% Example:[HCL,HRCL] = combat_centiloid(AV45_ADNI_SUVR,AV45_ADNI_Demo);
% Citing Information:Zhang Tianhao; Nie Binbin, Shan Baoci; 
% ComBat-Centiloid: A Calibration-Free Method for Quantifying Centiloid Values in Amyloid PET Imaging, 
% Brain Science Advances
% Author: Tianhao Zhang
% Date: 2024.12.02


    [STDPIBSUVR,STDmod,metaROIin84ROI,volumes] = getData;
    dat = [STDPIBSUVR;TRACERSUVR]';
    n = size(STDPIBSUVR,1);
    m = size(TRACERSUVR,1);
    batch = [ones(1,n),2*ones(1,m)];
    mod = [STDmod;TRACERmod];
    center = 1;
    dat_harm = combat_to_center(dat, batch, mod, 1,center);
    dat_harm = dat_harm';
    TRACERSUVR_harm = dat_harm(batch == 2,:);
    metaSUVR_harm = TRACERSUVR_harm(:,metaROIin84ROI);
    HCL = 120.16*(metaSUVR_harm*volumes)/sum(volumes) - 107.46;
    HRCL = 120.16*TRACERSUVR_harm - 107.46;
end
